import React from "react";
import s from './users.module.css'

let Users = (props) => {
    if (props.users.length === 0) {
        props.setUsers([
                {
                    id: 1,
                    photoUrl: 'data:image/jpeg;base64,',
                    followed: false,
                    fullName: 'Dmitry Kuzmin',
                    status: 'Hello',
                    location: {city: 'Minsk', country: 'Belarus'}
                },
                {
                    id: 2,
                    photoUrl: 'data:image/jpeg;base64,',
                    followed: true,
                    fullName: 'Nastya Vasilchenko',
                    status: 'Hello Hello',
                    location: {city: 'Brest', country: 'France'}
                },
                {
                    id: 3,
                    photoUrl: 'data:image/jpeg;base64,',
                    followed: true,
                    fullName: 'Igor Petrov',
                    status: 'Hello Hello Hello',
                    location: {city: 'New-York', country: 'America'}
                },
            ]
        )
    }
    return (<div>
        {
            props.users.map(u => <div key={u.id} className={s.usersContainer}>

                <div className={s.userButtonPhoto}>
                    <div>
                        <img src={u.photoUrl} className={s.userPhoto}/>
                    </div>
                    <div>
                        <div className={s.buttonContainer}>
                            {u.followed
                                ? <button className={s.button} onClick={() => {
                                    props.unfollow(u.id)
                                }}>Unfollow</button>
                                : <button  className={s.button} onClick={() => {
                                    props.follow(u.id)
                                }}>Follow</button>}
                        </div>
                    </div>

                </div>
                <div className={s.userInfo}>
                    <div>
                        <div>{u.fullName}</div>
                        <div>{u.status}</div>
                    </div>
                    <div>
                        <div>{u.location.country}</div>
                        <div>{u.location.city}</div>
                    </div>
                </div>
            </div>)
        }
    </div>)
};

export default Users;